var networkOperators []networkOperation
var once sync.Once

func networkOperatorsData() []networkOperation {
	once.Do(func() {
		rd := brotli.NewReader(bytes.NewBuffer(networkOperatorsBody))
		rb, _ := ioutil.ReadAll(rd)

		if err := json.Unmarshal(rb, &networkOperators); err != nil {
			panic(err.Error())
		}

		networkOperatorsBody = nil
	})

	return networkOperators
}

type networkOperation struct {
	CountryName     string `json:"countryName"`
	NetworkOperator string `json:"operator"`
}

// FindOperator .
func FindOperator(countryName string) (networkOperator string) {
	dataList := networkOperatorsData()
	size := len(dataList)

	for i := 0; i < size; i++ {
		if dataList[i].CountryName == countryName {
			networkOperator = dataList[i].NetworkOperator
			return
		}
	}

	return
}
